INSERT INTO note VALUES('eddd052b67a190f6d3272a4823d','N0022',0,1634584564,0,'{"_class":"Note","handle":"eddd052b67a190f6d3272a4823d","gramps_id":"N0022","text":{"_class":"StyledText","string":"Listing this as a Civil Union as it appears the magical world recognises this as a marriage, but \n1) if she was under the Imperius Curse, her concent was fatally impaired\n2) it is unclear her husband was in fact deceased prior to this union. In fact, it is strongly implied he was not. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":9,"string":""},"change":1634584564,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eddd27af83e41b39cd52c9b75ce','N0023',0,1634588183,0,'{"_class":"Note","handle":"eddd27af83e41b39cd52c9b75ce","gramps_id":"N0023","text":{"_class":"StyledText","string":"The existance of this person is infered from the two sources, If Rodolphus and Rabastan Lestrange were in the same gang as Snape, then they are not the Lestrange who was a classmate of Riddle''s.  ","tags":[]},"format":0,"type":{"_class":"NoteType","value":4,"string":""},"change":1634588183,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eddd28b415eda83d5b76b69fa8','N0024',0,1634588290,0,'{"_class":"Note","handle":"eddd28b415eda83d5b76b69fa8","gramps_id":"N0024","text":{"_class":"StyledText","string":"Assuming there are *more* British Lestranges in what seems to be a predominately French family stretches probability. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":9,"string":""},"change":1634588290,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eed52bf164d4c60257e88fae22e','N0025',0,1641245829,0,'{"_class":"Note","handle":"eed52bf164d4c60257e88fae22e","gramps_id":"N0025","text":{"_class":"StyledText","string":"Diggory was a fifth year and a lot bigger than Harry. \n\nRowling, J.K.. Harry Potter and the Prisoner of Azkaban (Harry Potter, Book 3) (p. 174). Pottermore Limited. American Kindle Edition. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":22,"string":""},"change":1641245829,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eed52f6adbb58ce57d7ad4c8c28','N0026',0,1641246193,0,'{"_class":"Note","handle":"eed52f6adbb58ce57d7ad4c8c28","gramps_id":"N0026","text":{"_class":"StyledText","string":"“This is Amos Diggory, everyone,” said Mr. Weasley. “He works for the Department for the Regulation and Control of Magical Creatures. And I think you know his son, Cedric?” \n\nRowling, J.K.. Harry Potter and the Goblet of Fire (Book 4) (Kindle Locations 1151-1152). Pottermore Limited. Kindle Edition. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":22,"string":""},"change":1641246193,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eed53467df33945f1301bcac90a','N0027',0,1641246716,0,'{"_class":"Note","handle":"eed53467df33945f1301bcac90a","gramps_id":"N0027","text":{"_class":"StyledText","string":"“The third and final task will take place at dusk on the twenty-fourth of June,” \n\nRowling, J.K.. Harry Potter and the Goblet of Fire (Book 4) (Kindle Locations 7585-7586). Pottermore Limited. Kindle Edition. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":22,"string":""},"change":1641246716,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eed7be2a1a44cd13cb7e3eb5999','N0028',0,1641314886,0,'{"_class":"Note","handle":"eed7be2a1a44cd13cb7e3eb5999","gramps_id":"N0028","text":{"_class":"StyledText","string":"Muggle father, witch mother\n\nRowling, J.K.. Short Stories from Hogwarts of Heroism, Hardship and Dangerous Hobbies (Kindle Single) (Pottermore Presents) (p. 6). Pottermore Publishing. American Kindle Edition. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":22,"string":""},"change":1641314886,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eed7c90108b6646f4c3a11fd79e','N0029',0,1641315985,0,'{"_class":"Note","handle":"eed7c90108b6646f4c3a11fd79e","gramps_id":"N0029","text":{"_class":"StyledText","string":"Minerva McGonagall was the first child, and only daughter, of a Scottish Presbyterian minister and a Hogwarts-educated witch. She grew up in the Highlands of Scotland in the early twentieth century, and only gradually became aware that there was something strange, both about her own abilities, and her parents’ marriage. Minerva’s father, the Reverend Robert McGonagall, had become captivated by the high-spirited Isobel Ross, who lived in the same village.\n\nRowling, J.K.. Short Stories from Hogwarts of Heroism, Hardship and Dangerous Hobbies (Kindle Single) (Pottermore Presents) (p. 7). Pottermore Publishing. Kindle Edition. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":22,"string":""},"change":1641315985,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eed7cc0e11dc36cda6ce5bf339','N0030',0,1641316305,0,'{"_class":"Note","handle":"eed7cc0e11dc36cda6ce5bf339","gramps_id":"N0030","text":{"_class":"StyledText","string":"The couple eloped, to the fury of both sets of parents.\n\nRowling, J.K.. Short Stories from Hogwarts of Heroism, Hardship and Dangerous Hobbies (Kindle Single) (Pottermore Presents) (p. 7). Pottermore Publishing. Kindle Edition. \n\nThe birth of the young couple’s first child, Minerva, proved both a joy and a crisis. Missing her family, and the magical community she had given up for love, Isobel insisted on naming her newborn daughter after her own grandmother, an immensely talented witch.\n\nRowling, J.K.. Short Stories from Hogwarts of Heroism, Hardship and Dangerous Hobbies (Kindle Single) (Pottermore Presents) (p. 7). Pottermore Publishing. Kindle Edition. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":22,"string":""},"change":1641316305,"tag_list":[],"private":false}');
INSERT INTO note VALUES('eed7cdad51d6843ad95f553fce6','N0031',0,1641316475,0,'{"_class":"Note","handle":"eed7cdad51d6843ad95f553fce6","gramps_id":"N0031","text":{"_class":"StyledText","string":"Minerva helped her mother explain to Malcolm and Robert Junior that they must not flaunt their magic,\n\nRowling, J.K.. Short Stories from Hogwarts of Heroism, Hardship and Dangerous Hobbies (Kindle Single) (Pottermore Presents) (p. 8). Pottermore Publishing. Kindle Edition. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":22,"string":""},"change":1641316475,"tag_list":[],"private":false}');
INSERT INTO note VALUES('f20ca15a53a445c673d2d38ecda','N0032',0,1663350378,0,'{"_class":"Note","handle":"f20ca15a53a445c673d2d38ecda","gramps_id":"N0032","text":{"_class":"StyledText","string":"The source material is somewhat unclear.  Muriel says that Kendra pretended not to be muggleborn and Doge objects that *she did not pretend* not that *she was not muggleborn.*  I think the falsehood were in the earlier part, the more natural objection would be to say \"she *was* x, she didn''t have to pretend.\"  However, the falsehood is that she denied her heritage, thus \"she didn''t pretend.\"  ","tags":[]},"format":0,"type":{"_class":"NoteType","value":4,"string":""},"change":1663350378,"tag_list":[],"private":false}');
INSERT INTO note VALUES('f20ca680fc33ac6bb64af98dd33','N0033',0,1663350956,0,'{"_class":"Note","handle":"f20ca680fc33ac6bb64af98dd33","gramps_id":"N0033","text":{"_class":"StyledText","string":"The source text implies that it is believed that Percival was a supporter of blood purity due to his silence at his trial.  Assuming this widely held opinion is correct, it only makes sense if he is himself a pure-blood and his wife''s blood status largely unknown despite my inference. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":4,"string":""},"change":1663350956,"tag_list":[],"private":false}');
INSERT INTO note VALUES('f20ca7b30f07d29b9dff2d0f7bb','N0034',0,1663351044,0,'{"_class":"Note","handle":"f20ca7b30f07d29b9dff2d0f7bb","gramps_id":"N0034","text":{"_class":"StyledText","string":"The Dumbledore family cannot have been a promenent one, or the blood status of Kendra Dumbledore would have been widely known. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":9,"string":""},"change":1663351044,"tag_list":[],"private":false}');
INSERT INTO note VALUES('f6db60ad8645b37e9855fe3f9b9','N0035',0,1696388001,0,'{"_class":"Note","handle":"f6db60ad8645b37e9855fe3f9b9","gramps_id":"N0035","text":{"_class":"StyledText","string":"The Rowling Index has Cirgnus, the HP Lexicon Cygnus.  Of the two, Cirgnus is likely to be an OCR error as Cygnus and not Cirgnus has actual google results for stars and constelations. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":4,"string":""},"change":1696388001,"tag_list":[],"private":false}');
INSERT INTO note VALUES('fc76772643b3efcde9f467c4718','N0036',0,1734910845,0,'{"_class":"Note","handle":"fc76772643b3efcde9f467c4718","gramps_id":"N0036","text":{"_class":"StyledText","string":"Per _Secrets of the Classlist_, Lavender was originally listed as a pure-blood, but her status \"probably\" changed, because she consistently reacts with surprise to magic.  On the other hand, she was a resident in the room of requirement for the seventh year.  This leads me to conclude she is a half blood that was raised in the muggle world, her parent(s) were probably in hidding.  She may be the child of two first generation magicals.  ","tags":[]},"format":0,"type":{"_class":"NoteType","value":4,"string":""},"change":1734910845,"tag_list":[],"private":false}');
INSERT INTO note VALUES('fdcb8e5a8566091810f0aa7f72c','N0037',0,1744066928,0,'{"_class":"Note","handle":"fdcb8e5a8566091810f0aa7f72c","gramps_id":"N0037","text":{"_class":"StyledText","string":"I am including Nagini as definitively a person despite the only cannonical source for this being the Fantastic Beasts series, because I find the logic in the Harry Potter Wiki page on her persuasive.  This page indicates that her back story is material that did not make the final cust for book seven, but *could* have been included there - and thus was envisioned prior to the historical revisionism of Fanstastic Beasts. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":4,"string":""},"change":1744066928,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff60838a148578d3a6c1077b227','N0038',0,1754947538,0,'{"_class":"Note","handle":"ff60838a148578d3a6c1077b227","gramps_id":"N0038","text":{"_class":"StyledText","string":"","tags":[]},"format":0,"type":{"_class":"NoteType","value":1,"string":""},"change":1754947538,"tag_list":[],"private":false}');
