INSERT INTO note VALUES('ff60af617d040e39f55d6a33d6b','N0043',1,1754946211,0,'{"_class":"Note","handle":"ff60af617d040e39f55d6a33d6b","gramps_id":"N0043","text":{"_class":"StyledText","string":"> Linfred of Stinchcombe, a locally well-beloved and\n> eccentric man, whose nickname, ‘the Potterer’, became corrupted in time to ‘Potter’.\n\nHis eldest son marries the oldest granddaughter of [Ignotus] [Peverell].\n\n[Ignotus]: <./people/Peverell/Ignotus>\n\n[Peverell]: <./people/Peverell/>\n","tags":[]},"format":true,"type":{"_class":"NoteType","value":4,"string":""},"change":1754946211,"tag_list":[],"private":false}');
