INSERT INTO note VALUES('ff60e1c8c8f49c7f69452af337e','N0045',0,1754947312,0,'{"_class":"Note","handle":"ff60e1c8c8f49c7f69452af337e","gramps_id":"N0045","text":{"_class":"StyledText","string":"We do not know exactly when or why in 1977 she died.","tags":[]},"format":0,"type":{"_class":"NoteType","value":10,"string":""},"change":1754947312,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff60e2cc93e2e8c25313bbbb29c','N0046',0,1754947418,0,'{"_class":"Note","handle":"ff60e2cc93e2e8c25313bbbb29c","gramps_id":"N0046","text":{"_class":"StyledText","string":"[Callidora] will marry [Harfang Longbottom].  She is apparently alive as of Mrs. Rowling''s book timeline.\n\n[Callidora]: <./people/Black/Callidora>\n\n[Harfang Longbottom]: <./people/Longbottom/Harfang>\n","tags":[]},"format":0,"type":{"_class":"NoteType","value":10,"string":""},"change":1754947418,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff60e31d3115727e9908c0ef58a','N0047',1,1754947462,0,'{"_class":"Note","handle":"ff60e31d3115727e9908c0ef58a","gramps_id":"N0047","text":{"_class":"StyledText","string":"[Callidora] will marry [Harfang Longbottom].  She is apparently alive as of Mrs. Rowling''s book timeline.\n\n[Callidora]: <./people/Black/Callidora>\n\n[Harfang Longbottom]: <./people/Longbottom/Harfang>\n","tags":[]},"format":true,"type":{"_class":"NoteType","value":4,"string":""},"change":1754947462,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff60e417b4757f6465cc5c236bd','N0048',1,1754947554,0,'{"_class":"Note","handle":"ff60e417b4757f6465cc5c236bd","gramps_id":"N0048","text":{"_class":"StyledText","string":"[Mnemone] is best known as the developer of Memory Modification Charms. From this we know they were developed at least slightly before this time.\n\n[Mnemone]: /Harrypedia/people/Radford/Mnemone\n","tags":[]},"format":true,"type":{"_class":"NoteType","value":4,"string":""},"change":1754947554,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff61203dac74246322d846813f8','N0049',0,1754953861,0,'{"_class":"Note","handle":"ff61203dac74246322d846813f8","gramps_id":"N0049","text":{"_class":"StyledText","string":"At an unknown point in the 1960s, but based on inference from other dates probably 1965, Lucius Malfoy starts his first year at Hogwarts.","tags":[]},"format":0,"type":{"_class":"NoteType","value":11,"string":""},"change":1754953861,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff6123439c078d8ee6ea0ba73ce','N0050',0,1754954178,0,'{"_class":"Note","handle":"ff6123439c078d8ee6ea0ba73ce","gramps_id":"N0050","text":{"_class":"StyledText","string":"This was calculated from when he started. ","tags":[]},"format":0,"type":{"_class":"NoteType","value":10,"string":""},"change":1754954178,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff61addcc3c2eaf20c78763f7ad','N0051',1,1754968711,0,'{"_class":"Note","handle":"ff61addcc3c2eaf20c78763f7ad","gramps_id":"N0051","text":{"_class":"StyledText","string":"[Hogwarts] was founded “over a thousand years” before HP2. The society the founders recruited students from would have included both Chrstians and papans. Given [Bill]’s work in [Egypt], I believe that before the [Statute of Secrecy], magic was woven into pagan societies, often as part of the priest classes. While we have no direct support for this in cannon, it provides the best explanation of the things the [Weasley]s state they encounter in their trip to visit that country.\n\n[Hogwarts]: ./Hogwarts\n[Bill]: <./people/Weasley/William Arthur>\n[Egypt]: ./Egypt\n[Weasley]: ./people/Weasley\n","tags":[]},"format":true,"type":{"_class":"NoteType","value":10,"string":""},"change":1754968711,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff61b61f58e6bd91c1a4e3620c4','N0052',1,1754969577,0,'{"_class":"Note","handle":"ff61b61f58e6bd91c1a4e3620c4","gramps_id":"N0052","text":{"_class":"StyledText","string":"> The Malfoy name comes from old French and translates as ‘bad faith’. Like many other progenitors of noble English families, the wizard Armand Malfoy arrived in Britain with William the Conqueror as part of the invading Norman army. Having rendered unknown, shady (and almost certainly magical) services to King William I, Malfoy was given a prime piece of land in Wiltshire, seized from local landowners, upon which his descendants have lived for ten consecutive centuries.\n\n","tags":[]},"format":true,"type":{"_class":"NoteType","value":10,"string":""},"change":1754969577,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff61c0b435a19ff8287b16f7662','N0053',1,1754970687,0,'{"_class":"Note","handle":"ff61c0b435a19ff8287b16f7662","gramps_id":"N0053","text":{"_class":"StyledText","string":"The Ministry was esablished by and from the pre-existing Wizards'' Council and Wizengamot (possibly the same thing).","tags":[]},"format":true,"type":{"_class":"NoteType","value":10,"string":""},"change":1754970687,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff61c4fe561217226ecc383e5d9','N0054',1,1754971136,0,'{"_class":"Note","handle":"ff61c4fe561217226ecc383e5d9","gramps_id":"N0054","text":{"_class":"StyledText","string":"[Ralston] Potter was seated in the [Wizengamot] from 1612 to 1652. He is known for his participation in the debates surounding the [Statute of Secrecy].\n\n[Statute of Secrecy]: <./culture/International Statute of Secrecy>\n\n      \n[Wizengamot]: <./culture/Government/>\n\n      \n[Ralston]: <./people/Potter/Ralston>","tags":[]},"format":true,"type":{"_class":"NoteType","value":10,"string":""},"change":1754971136,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff621132e9413afe29f358a6cb4','N0055',0,1754979127,0,'{"_class":"Note","handle":"ff621132e9413afe29f358a6cb4","gramps_id":"N0055","text":{"_class":"StyledText","string":"Passed at an unknown point this year.\n\n","tags":[]},"format":0,"type":{"_class":"NoteType","value":10,"string":""},"change":1754979127,"tag_list":[],"private":false}');
INSERT INTO note VALUES('ff6218508043c80e351476405f0','N0056',1,1754979873,0,'{"_class":"Note","handle":"ff6218508043c80e351476405f0","gramps_id":"N0056","text":{"_class":"StyledText","string":"Voted out of office because he failed to take [Gellert Grindelwald] seriously.\n\n[Gellert Grindelwald]: ./people/Grindelwald/Gellert\n","tags":[]},"format":true,"type":{"_class":"NoteType","value":10,"string":""},"change":1754979873,"tag_list":[],"private":false}');
